            "c": "\u05e1\u05d9\u05de\u05df \u05db\u05de\u05ea\u05d5\u05d0\u05e8 \u05d1\u05ea\u05de\u05d5\u05e0\u05d4 83.",
            "b": "\u05e1\u05d9\u05de\u05df \u05db\u05de\u05ea\u05d5\u05d0\u05e8 \u05d1\u05ea\u05de\u05d5\u05e0\u05d4 81.",
            "d": "\u05d0\u05d9\u05df \u05e6\u05d5\u05e8\u05da \u05d1\u05e1\u05d9\u05de\u05df \u05d9\u05d5\u05dd."
