            "c": "\u05d0\u05d5\u05e8\u05d5\u05ea \u05e1\u05d9\u05e4\u05d5\u05df, \u05d0\u05d5\u05e8\u05d5\u05ea \u05d9\u05e8\u05db\u05ea\u05d9\u05d9\u05dd \u05d5\u05d0\u05d5\u05e8 \u05e8\u05d0\u05e9 \u05ea\u05d5\u05e8\u05df.",
            "d": "\u05de\u05de\u05d5\u05db\u05df \u05d9\u05d3\u05dc\u05d9\u05e7 \u05d0\u05d5\u05e8 \u05e8\u05d0\u05e9 \u05ea\u05d5\u05e8\u05df."
