            "b": "\u05e9\u05e0\u05d9 \u05de\u05e9\u05d5\u05dc\u05e9\u05d9\u05dd \u05e9\u05e7\u05d5\u05d3\u05e7\u05d5\u05d3\u05d9\u05d4\u05dd \u05de\u05d7\u05d5\u05d1\u05e8\u05d9\u05dd.",
            "c": "\u05de\u05e2\u05d5\u05d9\u05df \u05e9\u05d7\u05d5\u05e8.",
            "d": "\u05e2\u05d9\u05d2\u05d5\u05dc \u05de\u05e2\u05d5\u05d9\u05df \u05e2\u05d9\u05d2\u05d5\u05dc."
