            "b": "\u05dc\u05d4\u05e7\u05d9\u05dd \u05e7\u05e9\u05e8 \u05d1\u05e2\u05e8\u05d5\u05e5 12 \u05e2\u05dd \u05ea\u05e6\u05e4\u05d9\u05ea \u05e0\u05de\u05dc \u05d7\u05d9\u05e4\u05d4 \u05d5\u05dc\u05d3\u05d5\u05d5\u05d7 \u05de\u05d9\u05e7\u05d5\u05de\u05da, \u05d6\u05d4\u05d5\u05ea\u05da \u05d5\u05db\u05dc \u05d4\u05e0\u05d3\u05e8\u05e9 \u05de\u05de\u05da.",
            "c": "\u05dc\u05d4\u05e7\u05d9\u05dd \u05e7\u05e9\u05e8 \u05e2\u05dd RCC HAIFA \u05d1\u05e2\u05e8\u05d5\u05e5 16 )0X4( \u05d5\u05dc\u05d3\u05d5\u05d5\u05d7 \u05de\u05d9\u05e7\u05d5\u05de\u05da \u05d6\u05d4\u05d5\u05ea\u05da \u05d5\u05db\u05d3'.",
            "d": "\u05dc\u05d4\u05e7\u05d9\u05dd \u05e7\u05e9\u05e8 \u05e2\u05dd \u05ea\u05d7\u05e0\u05ea \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05d2\u05d1\u05d5\u05dc\u05d5\u05ea \u05d1\u05e2\u05e8\u05d5\u05e5 11 \u05d5\u05dc\u05d3\u05d5\u05d5\u05d7 \u05de\u05d9\u05e7\u05d5\u05de\u05da, \u05d6\u05d4\u05d5\u05ea\u05da \u05d5\u05db\u05d3'."
