            "b": "\u05d1\u05e1\u05e4\u05d9\u05e0\u05d4, \u05d7\u05d5\u05d1\u05d4 \u05e9\u05d9\u05d4\u05d9\u05d5 \u05dc\u05e4\u05d7\u05d5\u05ea 4 \u05e8\u05e7\u05d8\u05d5\u05ea \u05de\u05e6\u05e0\u05d7.",
            "c": "\u05d1\u05e1\u05e4\u05d9\u05e0\u05d4 \u05d7\u05d5\u05d1\u05d4 \u05e9\u05d9\u05d4\u05d9\u05d5 \u05dc\u05e4\u05d7\u05d5\u05ea 4 \u05d0\u05d1\u05d5\u05e7\u05d5\u05ea \u05d9\u05d3.",
            "d": "\u05de\u05e6\u05d5\u05e3 \u05e2\u05e9\u05df \u05e4\u05d5\u05e2\u05dc \u05d1\u05de\u05e9\u05da \u05d6\u05de\u05df \u05e9\u05dc 12 \u05d3\u05e7\u05d5\u05ea \u05dc\u05e4\u05d7\u05d5\u05ea."
