            "b": "\u05e6\u05de\u05d3 \u05d4\u05d3\u05d2\u05dc\u05d9\u05dd N+ A, \u05e7\u05d5\u05dc \u05e0\u05e4\u05e5 \u05ea\u05d5\u05ea\u05d7, \u05e6\u05e4\u05d9\u05e8\u05d4 \u05e7\u05e6\u05e8\u05d4",
            "c": "\u05e8\u05e7\u05d8\u05d4 \u05d1\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd, \u05e6\u05e4\u05d9\u05e8\u05d4 \u05de\u05de\u05d5\u05e9\u05db\u05ea \u05dc\u05dc\u05d0 \u05d4\u05e4\u05e1\u05e7\u05d4, \u05e0\u05e4\u05e0\u05d5\u05e4\u05d9 \u05d9\u05d3\u05d9\u05d9\u05dd \u05d0\u05d9\u05d8\u05d9\u05d9\u05dd \u05de\u05e2\u05dc\u05d4 \u05de\u05d8\u05d4 \u05dc\u05e6\u05d9\u05d3\u05d9 \u05d4\u05d2\u05d5\u05e3.",
