            "c": "\u05de\u05d1\u05e7\u05e9 \u05d0\u05d9\u05e9\u05d5\u05e8\u05da \u05dc\u05e2\u05e7\u05d5\u05e3 \u05d0\u05d5\u05ea\u05da \u05de\u05d9\u05de\u05d9\u05df.",
            "b": "\u05d6\u05d4\u05d9\u05e8\u05d5\u05ea \u05d0\u05e0\u05d9 \u05de\u05d5\u05d2\u05d1\u05dc \u05d1\u05db\u05d5\u05e9\u05e8\u05d9 \u05dc\u05ea\u05de\u05e8\u05df.",
            "d": "\u05de\u05de\u05d5\u05db\u05df \u05e9\u05d0\u05d9\u05e0\u05d9 \u05e2\u05d5\u05e9\u05d4 \u05d3\u05e8\u05db\u05d9 \u05d1\u05de\u05d9\u05dd."
