            "b": "\u05e1\u05e4\u05d9\u05e0\u05ea\u05d9 \u05d1\u05e8\u05d9\u05d0\u05d4, \u05de\u05d1\u05e7\u05e9 \u05e8\u05e9\u05d5\u05ea \u05dc\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d7\u05d5\u05e4\u05e9\u05d9\u05ea \u05d1\u05e0\u05de\u05dc."
