            "b": "\u05d1\u05d9\u05e8\u05db\u05ea\u05d9\u05d9\u05dd, \u05d3\u05d2\u05dc \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05de\u05d0\u05e8\u05d7\u05ea, \u05d1\u05d7\u05e8\u05d8\u05d5\u05dd \u05d3\u05d2\u05dc \u05d9\u05e9\u05e8\u05d0\u05dc )\u05e2\u05dc \u05de\u05d5\u05d8( \u05de\u05d9\u05de\u05d9\u05df \u05dc\u05ea\u05d5\u05e8\u05df \u05d3\u05d2\u05dc Q.",
            "c": "\u05de\u05d9\u05de\u05d9\u05df \u05dc\u05ea\u05d5\u05e8\u05df, \u05d3\u05d2\u05dc \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05de\u05d0\u05e8\u05d7\u05ea, \u05de\u05e9\u05de\u05d0\u05dc \u05dc\u05ea\u05d5\u05e8\u05df Q, \u05d1\u05d9\u05e8\u05db\u05ea\u05d9\u05d9\u05dd \u05d3\u05d2\u05dc \u05d9\u05e9\u05e8\u05d0\u05dc \u05e2\u05dc \u05de\u05d5\u05d8.",
            "d": "\u05de\u05d9\u05de\u05d9\u05df \u05dc\u05ea\u05d5\u05e8\u05df, \u05d3\u05d2\u05dc Q \u05d5\u05de\u05ea\u05d7\u05ea\u05d9\u05d5 \u05d3\u05d2\u05dc \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05de\u05d0\u05e8\u05d7\u05ea \u05d5\u05de\u05e9\u05de\u05d0\u05dc \u05dc\u05ea\u05d5\u05e8\u05df \u05d3\u05d2\u05dc \u05d9\u05e9\u05e8\u05d0\u05dc."
