            "c": "\u05d0\u05ea\u05e7\u05e8\u05d1 \u05de\u05d9\u05d3, \u05db\u05d9 \u05d3\u05e8\u05d5\u05e9\u05d4 \u05e2\u05d6\u05e8\u05d4 \u05de\u05d9\u05d9\u05d3\u05d9\u05ea.",
            "b": "\u05d0\u05d1\u05e8\u05e8 \u05de\u05d4 \u05d4\u05d1\u05e2\u05d9\u05d4 )\u05ea\u05d9\u05d0\u05d5\u05dd \u05e2\u05de\u05d3\u05d5\u05ea(.",
            "d": "\u05d0\u05d9\u05df \u05db\u05dc \u05d1\u05e2\u05d9\u05d4, \u05d6\u05d4\u05d5 \u05d4\u05d3\u05d2\u05dc \u05d4\u05dc\u05d0\u05d5\u05de\u05d9 \u05e9\u05dc \u05de\u05d5\u05e0\u05d6\u05d9\u05d4."
