            "d": "\u05d3\u05d2\u05dc \u05e6\u05d4\u05d5\u05d1, \u05d3\u05d2\u05dc \u05d7\u05d1\u05e8\u05ea \u05d4\u05d0\u05e0\u05d9\u05d5\u05ea, \u05d3\u05d2\u05dc \u05d4\u05dc\u05d0\u05d5\u05dd."
