            "b": "K \u05de\u05e4\u05e0\u05d4 \u05dc M \u05de\u05de\u05d5\u05db\u05df \u05de\u05e4\u05e0\u05d4 \u05dc\u05de\u05d5\u05d2\u05d1\u05dc.",
