            "d": "K \u05de\u05e4\u05e0\u05d4 \u05dc M \u05de\u05de\u05d5\u05db\u05df \u05de\u05e4\u05e0\u05d4 \u05dc\u05db\u05dc\u05d9 \u05e9\u05d9\u05d9\u05d8 \u05dc\u05dc\u05d0 \u05e9\u05dc\u05d9\u05d8\u05d4."
