            "b": "H \u05de\u05e4\u05e0\u05d4 \u05dc P, \u05d3\u05d9\u05d9\u05d2 \u05de\u05e4\u05e0\u05d4 \u05dc\u05de\u05d5\u05d2\u05d1\u05dc",
            "c": "\u05db\u05dc \u05d0\u05d7\u05d3 \u05e4\u05d5\u05e0\u05d4 \u05dc\u05d9\u05de\u05d9\u05df \u05e9\u05dc\u05d5, \u05e9\u05e0\u05d9 \u05de\u05de\u05d5\u05db\u05e0\u05d9\u05dd \u05d7\u05e8\u05d8\u05d5\u05dd \u05de\u05d5\u05dc \u05d7\u05e8\u05d8\u05d5\u05dd",
            "d": "\u05db\u05dc \u05d0\u05d7\u05d3 \u05de\u05e4\u05e0\u05d4 \u05d9\u05de\u05d9\u05e0\u05d4, \u05e9\u05e0\u05d9 \u05db\u05dc\u05d9 \u05e9\u05d9\u05d9\u05d8 \u05de\u05d5\u05d2\u05d1\u05dc\u05d9\u05dd \u05d7\u05e8\u05d8\u05d5\u05dd \u05de\u05d5\u05dc \u05d7\u05e8\u05d8\u05d5\u05dd."
