            "b": "\u05e8\u05d5\u05d7 \u05e7\u05d9\u05d3\u05de\u05d9\u05ea \u05d7\u05d3\u05d4, \u05de\u05e4\u05e0\u05d4 \u05e9\u05de\u05d0\u05dc\u05d9.",
            "c": "\u05e8\u05d5\u05d7 \u05e6\u05d3, \u05de\u05e4\u05e0\u05d4 \u05e9\u05de\u05d0\u05dc\u05d9.",
            "d": "\u05e8\u05d5\u05d7 \u05de\u05dc\u05d0\u05d4."
