            "b": "\u05d1\u05e2\u05e8\u05e4\u05dc \u05d0\u05d5\u05ea \u05d6\u05d4 \u05de\u05e1\u05de\u05df \u05e9\u05db\u05dc\u05d9 \u05d4\u05e9\u05d9\u05d9\u05d8 \u05dc\u05d0 \u05e2\u05d5\u05e9\u05d4 \u05d3\u05e8\u05db\u05d5 \u05d1\u05de\u05d9\u05dd.",
