            "c": "\"O\" \u05de\u05de\u05d5\u05db\u05df \u05d5\"M \u05d3\u05d9\u05d9\u05d2, \u05d7\u05d5\u05d1\u05ea \u05d4\u05e4\u05d9\u05e0\u05d5\u05d9 \u05e2\u05dc \"O\" \u05d5\u05e2\u05dc\u05d9\u05d5 \u05dc\u05d4\u05ea\u05e8\u05d7\u05e7 \u05de\u05d4\u05de\u05db\u05e9\u05d5\u05dc \u05d4\u05e0\u05de\u05e6\u05d0 \u05e2\u05dc \u05d3\u05d5\u05e4\u05df \u05e9\u05de\u05d0\u05dc.",
